INSERT INTO `articles` (`id`, `categorie_id`, `title`, `content`, `date`) VALUES
(1, 1, 'Информационное письмо', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Информационное письмо</h3>\r\n<p><span style=\"line-height: 8pt;\">Об олимпиаде</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"line-height: 8pt; color: #d45500;\"><a style=\"color: #d45500;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/INF.PISMO_Vseros.Olimpiada_po_RADIOJeLEKTRONIKE_2016.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Информационное письмо всероссийской олимпиады по РАДИОЭЛЕКТРОНИКЕ 2016</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 11:45:11'),
(2, 1, 'Регламент', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Регламент</h3>\r\n<p><span style=\"font-size: 12pt;\">Олимпиады</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>РЕГЛАМЕНТ</strong><br /><strong> организации и проведения&nbsp;Всероссийской олимпиад</strong><strong>ы<br />профессионального мастерства по специальностям среднего профессионального образования</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #b34802;\"><a style=\"color: #b34802;\" href=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Reglament_2016.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 11:46:56'),
(3, 1, 'Порядок проведения', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Порядок проведения</h3>\r\n<p><span style=\"font-size: 12pt;\">Олимпиады</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"1\" align=\"center\"><strong>Порядок организации и проведения заключительного этапа всероссийской олимпиады</strong><br /><strong>профессионального мастерства по специальностям среднего профессионального образования</strong></p>\r\n<p class=\"1\" align=\"center\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ba4a00;\"><a style=\"color: #ba4a00;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/porjadok_provedenija_olimpiady_maj_2016.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:01:21'),
(4, 1, 'Заявка на участника', '<p>&nbsp;</p>\n<h3>Заявка на участника</h3>\n<p><span style=\"font-size: 12pt;\">Олимпиады</span></p>\n<p>&nbsp;</p>\n<p align=\"center\"><strong>ЗАЯВКА</strong><br /><strong> на участие в заключительном этапе&nbsp;Всероссийской олимпиады </strong><strong>профессионального мастерства по специальностям среднего профессионального образования&nbsp; </strong><strong style=\"line-height: 1.5em;\"><strong><br /></strong></strong></p>\n<p align=\"center\">&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"color: #b84900;\"><a style=\"color: #b84900;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/ZAJaVKA.docx\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать</a></span></p>', '2016-12-22 12:02:37'),
(5, 1, 'Регистрационная карта', '<h3>Регистрационная карта</h3>\n<p style=\"text-align: left;\" align=\"center\"><span style=\"font-size: 12pt;\">участников</span></p>\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>\n<p align=\"center\"><strong>РЕГИСТРАЦИОННАЯ КАРТА</strong><br /> <strong>участников Всероссийской олимпиады</strong><br /><strong>профессионального мастерства по специальностям среднего профессионального образования</strong></p>\n<p style=\"color: red;\"><strong>Уважаемые коллеги! Заполненная регистрационная карта высылается в отсканированном виде и в текстовом формате (*doc, *docх) по адресу: <a href=\"mailto:erttmetod@mail.ru\">erttmetod@mail.ru</a></strong></p>\n<p style=\"color: red;\">&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"color: #ab4400;\"><a style=\"color: #ab4400;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Registracionnaja_karta.doc\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать</a></span></p>', '2016-12-22 12:04:31'),
(6, 1, 'Программа олимпиады', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Программа олимпиады</h3>\r\n<p>&nbsp;</p>\r\n<p class=\"pad_bot2\">&nbsp;</p>\r\n<p align=\"center\"><strong>ПРОГРАММА</strong></p>\r\n<p align=\"center\"><strong>заключительного этапа Всероссийской олимпиады профессионального мастерства обучающихся </strong><strong>по специальностям</strong><strong> СПО</strong></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\"><span style=\"color: #ab4400;\"><a style=\"color: #ab4400;\" href=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/PROGRAMMA%20OLIMPIADY%2012-14%20maja%202016-1.doc\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать документ</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:06:44'),
(7, 1, 'Согласие на обработку персональных данных', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Согласие на обработку персональных данных</h3>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #a64200;\"><a style=\"color: #a64200;\" href=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Soglasie_na_obrabotku_personal%27nyh_dannyh.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Согласие на обработку персональных данных</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:08:09'),
(8, 1, 'Список необходимых документов', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Необходимые документы</h3>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><strong>Уважаемые участники олимпиады и сопровождающие участников преподаватели!</strong></p>\r\n<p>&nbsp;</p>\r\n<p>НАПОМИНАЮ, ЧТО УЧАСТНИКИ&nbsp; ОЛИМПИАДЫ ДОЛЖНЫ&nbsp; ПРЕДОСТАВИТЬ &nbsp;&nbsp;СЛЕДУЮЩИЕ ДОКУМЕНТЫ:</p>\r\n<p>&nbsp;</p>\r\n<p>1)&nbsp; студенческий билет;</p>\r\n<p>2)&nbsp; паспорт гражданина РФ (с приложением справки о регистрации в случае, если адрес прописки не совпадает с адресом проживания;</p>\r\n<p>3)&nbsp; копию паспорта гражданина РФ (с приложением справки о регистрации в случае, если адрес прописки не совпадает с адресом проживания);</p>\r\n<p>4)&nbsp; заявку на участие в заключительном этапе Всероссийской олимпиады профессионального мастерства с необходимыми подписями и печатями;</p>\r\n<p>5)&nbsp; справку с места учёбы, &nbsp;за подписью руководителя образовательной организации, заверенную печатью образовательной организации;</p>\r\n<p>6)&nbsp; копию лицевого разворота сберегательной книжки, либо копию договора банковской карты;</p>\r\n<p>7)&nbsp; все реквизиты отделения Сбербанка России;</p>\r\n<p>8)&nbsp; копию титульного листа Устава образовательной организации и страницы, где указано полное название с указанием организационно-правовой формы, в которой обучается/обучался на момент проведения Всероссийской олимпиады участник.</p>\r\n<p>9)&nbsp; полис обязательного медицинского страхования;</p>\r\n<p>10) заявление о согласии на обработку персональных данных участника олимпиады.</p>\r\n<p class=\"4\">11)&nbsp; медицинскую справку.</p>\r\n<p>&nbsp;</p>\r\n<p><em>Все документы необходимы, т.к. победитель и призёры Всероссийской олимпиады получают премии, выделяемые в рамках приоритетного национального проекта &laquo;Государственная поддержка талантливой молодёжи&raquo;.</em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #b04600;\"><a style=\"color: #b04600;\" href=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Spisok_neobhodimyh_dokumentov.docx\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать документ</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:09:31'),
(9, 2, 'Профессиональное задание', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Профессиональное задание</h3>\r\n<p><span style=\"font-size: 12pt;\">Конкурс</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #b54800;\"><a style=\"color: #b54800;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Primer%20zadanija%202%20uroven.pdf\">Примерное задание 2 уровень </a><a style=\"color: #b54800;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Primer%20zadanija%202%20uroven.pdf\">(Изменено с 12.04.16)</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:11:26'),
(10, 2, 'Теоретическое задание', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Теоретическое задание</h3>\r\n<p><span style=\"line-height: 8pt; font-size: 12pt;\">Конкурс</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"justifyleft\" style=\"text-align: center;\"><span style=\"color: #b54800;\"><a style=\"color: #b54800;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Teoreticheskoe%20zadanie.pdf\">Примерное задание 1 уровень </a><a style=\"color: #b54800;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Primer%20zadanija%202%20uroven.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">(Изменено с 12.04.16)</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:13:27'),
(11, 2, 'Жюри', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3>Состав жюри</h3>\r\n<p><span style=\"font-size: 12pt;\">заключительного этапа Всероссийской олимпиады профессионального мастерства</span></p>\r\n<p>&nbsp;</p>\r\n<p>Председатель жюри - Павлюк Иван Андреевич, председатель ФУМОСПО УГС 11.00.00, директор ГБПОУ г. Москвы &laquo;Колледж связи № 54 имени П.М. Вострухина&raquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>Члены жюри:</p>\r\n<p>1. Улыбин Сергей Игоревич, начальник монтажного производства ЗАО &laquo;Техносвязь&raquo;;</p>\r\n<p>2. Ивлев Андрей Дмитриевич, профессор, доктор технических наук Федерального государственного автономного образовательного учреждения высшего образования &laquo;Российский государственный профессионально-педагогический университет&raquo;;</p>\r\n<p>3 Стефанович Юрий Германович, заведующий лабораторией телевизионной техники, преподаватель профессиональных дисциплин и профессиональных модулей Уральского радиотехнического колледжа им. А.С. Попова;</p>\r\n<p>4. Шестаков Анатолий Александрович, руководитель отдела технического развития, преподаватель профессиональных дисциплин и профессиональных модулей Уральского радиотехнического колледжа им. А.С. Попова;</p>\r\n<p>5 Луценко Андрей Викторович, ведущий инженер-конструктор открытого акционерного общества &laquo;Уральское производственное предприятие &laquo;Вектор&raquo;;</p>\r\n<p>6. Митин Алексей Владимирович, начальник сектора ФГУП &laquo;Научно-производственное объединение автоматики&nbsp;имени академика Н.А.Семихатова&raquo;.</p>\r\n</body>\r\n</html>', '2016-12-22 12:14:57'),
(12, 5, 'Отчет', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n\r\n</body>\r\n</html>', '2016-12-22 12:41:39'),
(13, 5, 'Фотогалерея', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3 style=\"padding-left: 60px;\">Фотогалерея</h3>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/finale1.jpg\" alt=\"Победитель олимпиады, 1 место, г Тула\" width=\"461\" height=\"308\" /></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em>Победитель олимпиады, </em><em>1 место, г Тула</em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em><img src=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/finale2.jpg\" alt=\"Призер олимпиады, 2 место, г. Серпухов\" width=\"460\" height=\"307\" /></em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em>Призер олимпиады, </em><em>2 место, г. Серпухов</em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><img src=\"http://i.imgur.com/N2nrPUv.png\" width=\"455\" height=\"360\" /></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em>Призер олимпиады, 3 место, г. Нижний Новгород</em><em>&nbsp;</em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em><img src=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/finale4.jpg\" alt=\"Общая фотография участников и сопровождающих\" width=\"460\" height=\"306\" /></em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em>Общая фотография участников и сопровождающих</em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><em>&nbsp;</em></p>\r\n<p style=\"text-align: center;\" align=\"center\"><span style=\"color: #ff6600;\"><strong><a style=\"color: #ff6600;\" href=\"http://urtt.ru/resources/oly/rt/docs/Olimpiada%202016/FOTO.rar\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать все фотографии архивом</a></strong></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:55:19'),
(14, 5, 'Видео', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3 style=\"padding-left: 60px;\">Видео</h3>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><iframe src=\"https://www.youtube.com/embed/MAfSc8-iUKI\" width=\"500\" height=\"315\" frameborder=\"0\" data-mce-fragment=\"1\"></iframe></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #b04600;\"><a style=\"color: #b04600;\" href=\"https://www.youtube.com/watch?v=MAfSc8-iUKI\">Ссылка на видео</a></span></p>\r\n</body>\r\n</html>', '2016-12-22 12:56:27');

