(5, 'Итоги', '<p>&nbsp;</p>\n<p style=\"text-align: center;\" align=\"center\"><strong>СВОДНАЯ ВЕДОМОСТЬ</strong></p>\n<p style=\"text-align: center;\" align=\"center\"><strong>оценок результатов выполнения профессионального комплексного задания</strong></p>\n<p style=\"text-align: center;\" align=\"center\"><strong>&nbsp;Всероссийской олимпиады профессионального мастерства обучающихся</strong></p>\n<p style=\"text-align: center;\" align=\"center\"><strong>по специальностям среднего профессионального образования</strong></p>\n<p style=\"text-align: center;\" align=\"center\"><strong>в 2016 году</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">Этап Всероссийской олимпиады: заключительный этап&nbsp;</p>\n<p style=\"text-align: center;\">Дата выполнения: 14 мая 2016 г.&nbsp;</p>\n<p>&nbsp;</p>\n<div align=\"center\">\n<table style=\"width: 100.12%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\n<thead>\n<tr>\n<td style=\"width: 4%;\" rowspan=\"2\">\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">№</span></p>\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">п/п</span></p>\n</td>\n<td style=\"font-size: 9px; width: 10%;\" rowspan=\"2\">\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">Номер участника, получен-ный при жеребьевке</span></p>\n</td>\n<td style=\"font-size: 9px; width: 13%;\" rowspan=\"2\">\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">Фамилия, имя, отчество участника</span></p>\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">&nbsp;</span></p>\n</td>\n<td style=\"font-size: 9px; width: 30.0386%;\" rowspan=\"2\">\n<p style=\"font-size: 9px;\" align=\"center\"><span style=\"font-size: 9pt;\">Наименование субъекта Российской Федерации и образовательного учреждения</span></p>\n</td>\n<td style=\"font-size: 9px; width: 20%;\" colspan=\"2\">\n<p style=\"font-size: 