(20, 'Контакты', '<p>Контактная информация</p>\n<p>&nbsp;</p>\n<p><strong>Адрес образовательного учреждения:</strong><br /> 620131, Екатеринбург, улица Крауля, дом № 168<br /> тел.: (343) 242-50-64, факс: (343)242-50-64, 242-54-82<br /> E-mail: <span style=\"color: #b04600;\"><a style=\"color: #b04600;\" href=\"mailto:radio-college@urtk.su\" target=\"_blank\" rel=\"noopener noreferrer\">radio-college@urtk.su</a></span>,<br /> сайт: <span style=\"color: #b04600;\"><a style=\"color: #b04600;\" href=\"http://www.urtt.ru\" target=\"_blank\" rel=\"noopener noreferrer\">www.urtt.ru</a></span></p>\n<p><strong>Способ прибытия к месту проведения Олимпиады СПО:</strong><br /> а) из центра города: автобусы № 2 и № 28 в сторону ВИЗа до остановки &laquo;Радиоколледж&raquo; (конечная);<br /> б) от железнодорожного вокзала и от Северного автовокзала: троллейбус № 17 в сторону ВИЗа до остановки &laquo;Крауля&raquo; (конечная);<br /> в) от Южного автовокзала: маршрутка № 025, автобус № 38 в сторону ВИЗа до остановки &laquo;Радиоколледж&raquo; (конечная).</p>\n<p><strong>Контактные телефоны:</strong><br /> директор - Самсонова Любовь Витальевна, (343)242-50-64; 8-902-87-999-75<br /> заместитель директора по УР - Колесников Дмитрий Владимирович, (343)242-50-80<br />Руководитель рабочей группы: заведующий методическим кабинетом - Алферьева Ольга Викторовна, (343)242-58-82; 8-922-29-788-34<br />Рабочая группа: руководитель отдела технического развития - Шестаков Анатолий Александрович, 8-922-20-172-29<br />Рабочая группа: руководитель профильного ресурсного центра ИТР - Терентьева Ольга Арсеньевна, 8-922-60-255-67</p>', 1);

