(18, 'Выложен список участников олимпиады', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3><span style=\"font-size: 12pt;\">Список участников олимпиады</span></h3>\r\n<p>&nbsp;</p>\r\n<p>1. Санкт-Петербургское государственное бюджетное образовательное учреждение среднего профессионального образования &laquo;Политехнический колледж городского хозяйства&raquo;<br /><br />2. Университетский колледж федерального государственного бюджетного образовательного учреждения высшего образования &laquo;Оренбургский государственный университет&raquo; (Университетский колледж ОГУ)<br /><br />3. Автономное профессиональное образовательное учреждение Удмуртской Республики &laquo;Техникум радиоэлектроники и информационных технологий&raquo; (АПОУ УР &laquo;ТРИТ&raquo;)<br /><br />4. Государственное бюджетное профессиональное образовательное учреждение Краснодарского края &laquo;Новороссийский колледж радиоэлектронного приборостроения&raquo;<br /><br />5. Государственное бюджетное профессиональное образовательное учреждение Владимирской области &laquo;Муромский колледж радиоэлектронного приборостроения&raquo;<br /><br />6. Государственное бюджетное профессиональное образовательное учреждение Ростовской области &laquo;Батайский техникум информационных технологий и радиоэлектроники &laquo;Донинтех&raquo;<br /><br />7. ГБПОУ Московской области &laquo;Серпуховский колледж&raquo;<br /><br />8. Государственное бюджетное профессиональное образовательное учреждение Калужской области &laquo;Калужский техникум электронных приборов&raquo;<br /><br />9. Федеральное казенное профессиональное образовательное учреждение &laquo;Ивановский радиотехнический техникум-интернат&raquo; Министерства труда и социальной защиты Российской Федерации (ФКПОУ &laquo;ИвРТТИ&raquo;&nbsp; Минтруда РФ<br /><br />10. Областное государственное бюджетное профессиональное образовательное учреждение &laquo;Смоленский политехнический техникум&raquo;<br /><br />11. Государственное бюджетное профессиональное образовательное учреждение Республики Крым &laquo;Симферопольский колледж радиоэлектроники&raquo;<br /><br />12. Государственное автономное профессиональное образовательное учреждение Чувашской Республики &laquo;Межрегиональный центр компетенций &ndash; Чебоксарский электромеханический колледж&raquo; Министерства образования и молодежной политики Чувашской Республики.<br /><br />13. Областное государственное бюджетное профессиональное образовательное учреждение &laquo;Рязанский политехнический колледж&raquo;</p>\r\n<p><br />14. Государственное бюджетное профессиональное образовательное учреждение Новосибирской области &laquo;Новосибирский радиотехнический колледж&raquo;<br /><br />15. Государственное бюджетное профессиональное образовательное учреждение &laquo;Челябинский радиотехнический техникум&raquo;<br /><br />16. ГБПОУ Образовательный комплекс &laquo;Юго-Запад&raquo;, города Москвы<br /><br />17. Государственное автономное профессиональное образовательное учреждение &laquo;Казанский радиомеханический колледж&raquo;<br /><br />18. Государственное профессиональное образовательное учреждение Тульской области &laquo;Тульский технико-экономический колледж имени А.Г.Рогова&raquo;<br /><br />19. Государственное профессиональное образовательное бюджетное учреждение &laquo;Республиканский электромеханический колледж&raquo;</p>\r\n<p><br />20. Государственное бюджетное учреждение &laquo;Нижегородский радиотехнический колледж&raquo;<br /><br />21. Автономное профессиональное образовательное учреждение Вологодской области &laquo;Вологодский колледж связи и информационных технологий&raquo;<br /><br />22. Государственное бюджетное профессиональное образовательное учреждение &laquo;Курганский технологический колледж имени Героя Советского союза Н.Я.Анфиногенова&raquo;<br /><br />23. Государственное бюджетное профессиональное образовательное учреждение Воронежской области &laquo;Воронежский государственный промышленно-гуманитарный колледж&raquo; (ГБПОУ ВО &laquo;ВГПГК&raquo;)<br /><br />24. Государственное бюджетное профессиональное образовательное учреждение Республики Марий Эл &laquo;Марийский радиомеханический техникум&raquo;<br /><br />25. Колледж ПсковГУ Федерального государственного бюджетного образовательного учреждения высшего профессионального образования \"Псковский государственный университет\"<br /><br />26. КГАПОУ &laquo;Пермский радиотехнический колледж им. А.С. Попова&raquo;<br /><br />27. Государственное бюджетное профессиональное образовательное учреждение Краснодарского края &laquo;Армавирский машиностроительный техникум&raquo; (ГБПОУ К К &laquo;АМТ&raquo;)<br /><br />28. Государственное автономное профессиональное образовательное учреждение Свердловской области &laquo;Уральский радиотехнический колледж им. А.С. Попова&raquo; (ГАПОУ СО УРТК им. А.С. Попова)</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #b34700;\"><a style=\"color: #b34700;\" href=\"http://www.urtt.ru/resources/oly/rt/docs/Olimpiada%202016/Spisok_uchastnikov.docx\" target=\"_blank\" rel=\"noopener noreferrer\">Скачать список участников документом</a></span></p>\r\n</body>\r\n</html>', '2016-04-30 18:24:30');
