(19, 'Выложена ведомость оценок результатов выполнения комплексного задания I уровня', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h3 style=\"padding-left: 60px;\"><span style=\"font-size: 12pt;\">ИТОГИ</span></h3>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\" align=\"center\"><strong>СВОДНАЯ ВЕДОМОСТЬ</strong></p>\r\n<p style=\"text-align: center;\" align=\"center\"><strong>оценок результатов выполнения профессионального комплексного задания</strong></p>\r\n<p style=\"text-align: center;\" align=\"center\"><strong>&nbsp;Всероссийской олимпиады профессионального мастерства обучающихся</strong></p>\r\n<p style=\"text-align: center;\" align=\"center\"><strong>по специальностям среднего профессионального образования</strong></p>\r\n<p style=\"text-align: center;\" align=\"center\"><strong>в 2016 году</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Этап Всероссийской олимпиады: заключительный этап&nbsp;</p>\r\n<p style=\"text-align: center;\">Дата выполнения: 14 мая 2016 г.&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<div style=\"text-align: center;\" align=\"center\">\r\n<table style=\"margin-left: auto; margin-right: auto;\" border=\"1\" width=\"80%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<thead>\r\n<tr>\r\n<td rowspan=\"2\" width=\"35\">\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">№</span></p>\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">п/п</span></p>\r\n</td>\r\n<td rowspan=\"2\" width=\"96\">\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">Номер участника, получен-ный при жеребьевке</span></p>\r\n</td>\r\n<td rowspan=\"2\" width=\"130\">\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">Фамилия, имя, отчество участника</span></p>\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">&nbsp;</span></p>\r\n</td>\r\n<td rowspan=\"2\" width=\"409\">\r\n<p align=\"center\"><span style=\"font-size: 9pt;\">Наименование субъекта Российской Федерации 